import React from 'react';
import data from './data.json';
import './Header.css';
export const Header = () => {
    return (
       <div className="header">

        <img src="./abc.png"></img>


         {data.pages.map((data, key) => {
          return (
            <div>
              {data.title }
            </div>
          );
        })}


            <div className="contact_us">

           </div>

       </div>


    )
}
export default Header;
